import { Link } from "react-router-dom"

const SideBar = () => {
  return (
    <div className="sidebar">
      <h2>Menu</h2>
      <ul>
        <li>
          <Link to="/about">About</Link>
        </li>
        <li>
          <a href="https://github.com/example">Git</a>
        </li>
        <li>
          <Link to="/contact">Contact</Link>
        </li>
      </ul>
    </div>
  );
};

export default SideBar;
